import logo from "./logo.svg";
import "./App.css";
import Header from "./components/Header/Header";

function App() {
  return (
    <>
      <Header />
      <div className="app">
        <Routes>
          <Route path="/" element={<HomeView />}></Route>
        </Routes>
      </div>
      <SimpleBottomNavigation />
    </>
  );
}

export default App;
